import React from "react";
import "./ToDoList.scss";

const ToDoList = () => {
    return (
        <div class="wrapper">
            <div class="align">
                <div class="app">
                    <div className="info">
                        <div className="info-bottom">
                    <div className="left">
                        <p id="count">7</p>
                        <p id="tasks">Total</p>
                    </div>
                    <div className="middle">
                        <p id="remaining_done">5</p>
                        <p id="remaining_tasks">Remaining</p>
                    </div>
                    <div className="right">
                        <p id="count_done">2</p>
                        <p id="tasks_done">Done</p>
                    </div>
                    </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default ToDoList;
